import com.eviware.soapui.model.testsuite.TestRunner.Status
def emailid,firstname,lastname
def filepath = "C:/SeleniumProject/data.xls"
File Excel = new File(filepath)

//i want to fetch the workbook and the sheet which contains data
Workbook wb = Workbook.getWorkbook(Excel)
//I want to fetch sheet
Sheet sh = wb.getSheet("Sheet1")
//i want to fecth no of rows and no of columns
 def rowsize = sh.getRows().toInteger()

 def columnsize = sh.getColumns().toInteger()


 log.info "$rowsize and $columnsize"

 //fetch the value in the variable

 for(def i=1;i<rowsize;i++)
 {
 	for(def j=0;j<columnsize;j++)
 	{
 		if (j==0)
 		{
 			emailid =sh.getCell(j,i).getContents()
 			log.info "$emailid"
 		}
 		else if(j==1)
 		{
 			firstname = sh.getCell(j,i).getContents()
 			log.info "$firstname"
 		}
 		else
 		{
 			lastname = sh.getCell(j,i).getContents()
 			log.info "$lastname"
 		}

 }

 	// get TestCase
def tc = testRunner.testCase.testSuite.project.testSuites["CustomerRepositorywith property transfer"].testCases["CustomerRepositorywithpropertyTransfer"]

// set credential properties from the script itself
tc.testSteps["Properties"].setPropertyValue("emailid", emailid )
